import React, { Component , Fragment, useState, useEffect } from "react";
import Scrollspy from 'react-scrollspy';
import ScrollToTop from 'react-scroll-up';
import { FiChevronUp , FiX , FiMenu } from "react-icons/fi";
import CounterOne from "../elements/counters/CounterTwo";
import Testimonial from "../elements/Testimonial";
import FooterTwo from "../component/footer/FooterTwo";
import Helmet from "../component/common/Helmet";
import TeamOne from "../blocks/team/TeamOne";
import Slider from "react-slick";
import { slickDot , portfolioSlick2 } from "../page-demo/script";
import ContactTwo from "../elements/contact/ContactTwo";
import { FiHeadphones , FiMail , FiMapPin} from "react-icons/fi";
import { FaInstagram } from 'react-icons/fa';

import ServiceList from '../elements/service/ServiceList'
import TypingAnimation from "../elements/common/TypingAnimation";
import { Parallax } from "react-parallax";

import './interiorStyles.css';


import AOS from 'aos';
import 'aos/dist/aos.css';
import { FaFacebookF, FaLinkedinIn } from 'react-icons/fa'; // Import the necessary icons

const image1 = '/assets/images/bg/riverTube2.0.png';

const NewStaffComp = ({ teamStyle, column }) => {
  const [selectedMember, setSelectedMember] = useState(null);

  const data = [
    {
      images: '01',
      title: 'Zach Martin',
      designation: 'President',
      summary: 'Zach Martin, the owner of ATX Float, is a driven entrepreneur whose journey from Florida to Ohio and eventually to Austin, Texas, reflects his commitment to turning a passion into a thriving business. With over 15 years of experience, he has honed his craft in creating enjoyable and innovative products for individuals seeking fun and relaxation. This wealth of experience has allowed Zach to build invaluable connections with some of the finest producers worldwide, enabling him to craft products that cater to a wide range of budgets and preferences. His unwavering dedication and expertise have found a perfect home in the world of tubes and water sports, bringing the joy of recreation and leisure to countless people. Zach Martin&aposs ATX Float is not just a business but a testament to his pursuit of making outdoor adventures more accessible and enjoyable for all.',
      socialNetwork: [
        {
          icon: <FaFacebookF />,
          url: '#'
        },
        {
          icon: <FaLinkedinIn />,
          url: '#'
        },
        {
          icon: <FaInstagram />,
          url: '#'
        },
      ]
    },
    {
      images: '02',
      title: 'Jay Perry',
      designation: 'Lead Sales',
      summary: 'Jay Perry stands as a key figure at ATX Float, where he has consistently led the company&apos;s sales efforts for an impressive five years. His unwavering dedication and expertise in the field have played an instrumental role in building and solidifying ATX Float&apos&apos;s reputation as a prominent player in the water sports industry. A true Texas native, Jay&apos;s roots run deep in the Lone Star State, where his local insights and understanding of the Texan lifestyle have greatly contributed to the company&apos;s success. His impressive track record as a leader in sales and his role in nurturing ATX Float&apos;s growth make him a central figure in the company&apos;s journey.',
      socialNetwork: [
        {
          icon: <FaFacebookF />,
          url: '#'
        },
        {
          icon: <FaLinkedinIn />,
          url: '#'
        },
      ]
    },
    {
      images: '03',
      title: 'Morgan Hondros',
      designation: 'Web Architech',
      summary: 'Some gibberish',
      socialNetwork: [
        {
          icon: <FaFacebookF />,
          url: 'https://www.facebook.com/morgan.hondros'
        },
        {
          icon: <FaLinkedinIn />,
          url: 'https://www.linkedin.com/in/morgan-hondros-781878151/'
        },
      ]
    },
  ];

  useEffect(() => {
    AOS.init();
  }, []);

  const getAnimation = (index) => {
    if (index === 0) {
      return 'fade-left';
    } else if (index === 1) {
      return 'fade-up';
    } else if (index === 2) {
      return 'fade-right';
    } else {
      return 'fade-up';
    }
  };

  const handleMemberClick = (memberIndex) => {
    setSelectedMember(memberIndex);
  };

  return (
    <div className="rn-team-wrapper pb--120 bg_color--1" id="team" style={{ backgroundColor: '#f3edd1', paddingTop: '70px' }}>
      {/* Your other component code here... */}
      <Parallax bgImage={image1} strength={800} style={{padding: '70px',}}>
      <div className="section-title text-left mb--30">
        <h2 style={{ color: '#EF5474', fontFamily: 'Brice-Black', textAlign: 'center', textShadow: '2px 2px 4px rgba(0, 0, 0, 0.6)' }} data-aos="fade-up" data-aos-duration="750">Meet Our Staff</h2>
      </div>
      <div className="row" style={{ display: 'flex', justifyContent: 'center' }}>
        {data.map((value, i) => (
          <div className={column} key={i} data-aos={getAnimation(i)} data-aos-duration="750">
            <div className={`team ${teamStyle}`}>
              <div className="thumbnail">
                <img src={`/assets/images/team/team-${value.images}.jpg`} alt="Team Member" />
              </div>
              <div className="content">
                <h4 className="title" onClick={() => handleMemberClick(i)}>
                  {value.title}
                </h4>
                <p className="designation">{value.designation}</p>
              </div>
              <ul className="social-icon">
              {value.socialNetwork.map((social, index) => (
  <li key={index}><a href={social.url}>{social.icon}</a></li>
))}

              </ul>
            </div>
            {selectedMember === i && (
              <div className="summary">
                <p style={{ color: 'white', fontFamily: 'Brice-Light' }}>{value.summary}</p>
              </div>
            )}
          </div>
        ))}
      </div>
      </Parallax>
    </div>
  );
};

export default NewStaffComp;
